/**
 * Create shader program based on shader url and pragma array
 * @param {string} url 
 */
raptorjs.resourceManager.prototype.createShaderProgram = function(url, pragmas, librarys) {

	var rawShaderText = raptorjs.resources.loadTextFileSynchronous(url, pragmas);
	var splitShader = rawShaderText.split("// #raptorEngine - Split");

	var vertextShaderRawText  = splitShader[0];
	var fragmentShaderRawText = splitShader[1];

	var vertexShader = gl.createShader(gl.VERTEX_SHADER);
	var fragmentShader = gl.createShader(gl.FRAGMENT_SHADER);

	for(var c = 0; c<librarys.length; c++) {
		var lib = librarys[c];

		if(lib.type == 0) {
			vertextShaderRawText = lib.content + vertextShaderRawText;
		} else {
			var index = fragmentShaderRawText.indexOf("void main()");
			
			fragmentShaderRawText = insertAt(fragmentShaderRawText, index, lib.content);
			
		}
		
		rawShaderText = lib.content + rawShaderText;
	}
	
	//add pragma's
	for(var c = 0; c<pragmas.length; c++) {
		var currentPragma = pragmas[c];
		
		switch (currentPragma.type) {
			case "define":
			
				var pragma = "#define " + currentPragma.name + " " + currentPragma.value + '    \n  ';
				
				fragmentShaderRawText = pragma + fragmentShaderRawText;
				vertextShaderRawText = pragma + vertextShaderRawText;
				
			break;
		}
	}
	
	this.rawShader = fragmentShaderRawText + vertextShaderRawText;
	
	gl.shaderSource(vertexShader, vertextShaderRawText);
	gl.compileShader(vertexShader);
	
	gl.shaderSource(fragmentShader, fragmentShaderRawText);
	gl.compileShader(fragmentShader);
	
	var program = gl.createProgram();
	
	gl.attachShader(program, vertexShader);
	gl.attachShader(program, fragmentShader);
	
	if (!gl.getShaderParameter(vertexShader, gl.COMPILE_STATUS)) {
		alert(gl.getShaderInfoLog(vertexShader));
		return null;
	}
	
	if (!gl.getShaderParameter(fragmentShader, gl.COMPILE_STATUS)) {
		alert(gl.getShaderInfoLog(fragmentShader));
		return null;
	}

	gl.linkProgram(program);

	if (!gl.getProgramParameter(program, gl.LINK_STATUS)) {
		alert("Could not initialise shaders");
	}

	gl.useProgram(program);
	
	var programInfo = raptorjs.createObject('programInfo');
	
	programInfo.program = program;
	programInfo.rawData = rawShaderText;
	programInfo.vertexShader = vertexShader;
	programInfo.fragmentShader = fragmentShader;
	programInfo.url = url;
	programInfo.pragmas = pragmas;
	programInfo.librarys = librarys;
	
	console.log('compiled shader: ', programInfo);
	
	return programInfo;
}

/**
 * load url
 * @param {string} url 
 */
raptorjs.resourceManager.prototype.loadTextFileSynchronous = function(url) {

	var fileContent = raptorjs.resources.getFile(url)
	
	if(fileContent) {
		return fileContent.data;
	}
	
	var request;

	if (window.XMLHttpRequest) {
		request = new XMLHttpRequest();
		if (request.overrideMimeType) {
		  request.overrideMimeType('text/plain');
		}
	} else if (window.ActiveXObject) {
		request = new ActiveXObject('MSXML2.XMLHTTP.3.0');
	} else {
		throw 'XMLHttpRequest is disabled';
	}
	
	request.open('GET', url, false);
	request.send(null);
	
	if (request.readyState != 4) {
		throw error;
	}
	
	var data = request.responseText;
	
	this.addFile(data, url);
	
	return data;
}

raptorjs.resourceManager.prototype.addFile = function(data, url) {
	var file = {};
	
	file.data = data;
	file.url = url;
	
	this.fileCache.push(file);
}

raptorjs.resourceManager.prototype.getFile = function(url) {
	for(var c = 0; c<this.fileCache.length; c++) {
		var file = this.fileCache[c];
		if(file.url == url)
			return file;
	}
	
	return false;
}

raptorjs.resourceManager.prototype.addTexture = function(adress, name, direct) {
	
	this.numberOfTextures++;
	this.textureTotal++;

	var texture = {};
	
	texture.adress = adress;
	texture.name = name;
	
	this.loadingList.push(texture);
	
	if(direct)
		this.loadTexture(adress, name);
};

